data:
  definition: établissement d'une chaîne de connexion avec un correspondant ou un
    groupe de correspondants, préalablement désignés par l'usager, sans utilisation
    d'une séquence de sélection
  examples: []
  notes:
  - Le réseau interprète le signal d'appel comme un ordre l'établissement d'une chaîne
    de connexion.
